FeedPackage.ReleaseNotes:
1) adds SPARQL.TripleChain()
2) SPARQL.Prefix() - Prefix parameter could be defined without colon;
3) minor fixes.

FeedPackage.Description:
Converts objects to DynamicTableEntities and DynamicTableEntities back to original objects. Handles conversion of complex objects with complex nested properties.

Usage: 

// Convert Order object to DynamicTableEntity
DynamicTableEntity dynamicTableEntity = DynamicTableEntityConverter.ConvertToDynamicTableEntity(order, "pk", "rk");

// Convert DynamicTableEntity back to Order object
Order originalOrder = DynamicTableEntityConverter.ConvertToPOCO<Order>(dynamicTableEntity);

